  false,\n\t\"url\": null,\n\t\"notes\": \"In February 2014, Quantum Spatial (QSI)
  was contracted by the Puget Sound LiDAR Consortium (PSLC) to collect Light Detection
  and Ranging (LiDAR) data for the City of Redmond site in western Washington. Data
  were collected to aid PSLC in assessing the topographic and geophysical properties
  of the study area. The accompany report discusses the delivered LiDAR data and documents
  contract specifications, data acquisition procedures, processing methods, and analysis
  of the final dataset including LiDAR accuracy and density.\",\n\t\"owner_org\":
